import React from "react";
import Card from "./Card";

export default function DynamicContent() {
  const cardData = [
    { id: 1, image: "image1.jpg", star: "star1.jpg", name: "Product 1", description: "Description 1", price: "$19.99" },
    { id: 2, image: "image2.jpg", star: "star2.jpg", name: "Product 2", description: "Description 2", price: "$29.99" },
    { id: 3, image: "image1.jpg", star: "star1.jpg", name: "Product 1", description: "Description 1", price: "$19.99" },
    { id: 2, image: "image2.jpg", star: "star2.jpg", name: "Product 2", description: "Description 2", price: "$29.99" },
    // Add more card data as needed
  ];

  return (
    <section className="dynamic-content">
      {cardData.map((card) => (
        <Card
          key={card.id}
          image={card.image}
          star={card.star}
          name={card.name}
          description={card.description}
          price={card.price}
        />
      ))}
    </section>
  );
}
